/*Inicio #001*/
import PSXP_RPTDEFNMANAGER:*;
import PSXP_XMLGEN:*;

Declare Function getCuentaPresupuesto PeopleCode FF_FUNCLIB_KK.FUNCLIB FieldFormula;
Declare Function getCuentaPresupDescr PeopleCode FF_FUNCLIB_KK.FUNCLIB FieldFormula;
Declare Function getGrupoContable PeopleCode FF_FUNCLIB_KK.FUNCLIB FieldFormula;
Declare Function getLedger PeopleCode FF_FUNCLIB_KK.FUNCLIB FieldFormula;
Declare Function getPeriodo PeopleCode FF_FUNCLIB_KK.FUNCLIB FieldFormula;
Declare Function NroLetra PeopleCode FF_FUNCLIB_KK.FUNCLIB FieldFormula;
Declare Function getSaldoInicioPeriodo PeopleCode FF_FUNCLIB_KK.FUNCLIB FieldFormula;
Declare Function getGastosEnPeriodo PeopleCode FF_FUNCLIB_KK.FUNCLIB FieldFormula;
Declare Function getTransaccionEnPeriodoHastaID PeopleCode FF_FUNCLIB_KK.FUNCLIB FieldFormula;

Function FF_IMP_VCHR(&str_tipo As string)

   Local Rowset &rsheader, &rsLineas, &rs_Comp_Lin, &rs_Comp_Lin_dist, &rs_Comp;
   Local string &BUSINESS_UNIT, &ID_DOCUMENTO, &DESCR_BU, &USUARIO, &SETID, &AREA_SOLI, &COMENTARIOS, &str_Articulo, &str_Deptid, &str_Descr;
   Local string &str_bu_gl, &str_num_cuenta, &SETID_GL, &str_Ledger_Group, &str_Tree_Name, &str_Tree_Lvl, &str_Calendar_id, &VENDOR_ID, &LC_TERC_ID, &NOMBRE_PROVE;
   Local string &str_setid, &str_account, &strCtaPres2;
   Local date &fecha_presu;
   Local Record &recinfo;
   Local SQL &sql_cuenta_iva;
   Local number &nbr_lineas, &nbr_lineas_act;
   Local boolean &bol_cuenta;
   &rsLineas = CreateRowset(Record.FF_VCHRLINE_WRK);
   &rsheader = CreateRowset(Record.FF_VCHR_DAT_WRK, &rsLineas);

   /*CARGO NIVEL HEADER*/
   /*Unidad de Negocio y descripcion*/
   &BUSINESS_UNIT = VOUCHER.BUSINESS_UNIT.Value;
   &rsheader.GetRow(1).FF_VCHR_DAT_WRK.BUSINESS_UNIT.Value = &BUSINESS_UNIT;
   REM-->002 Se toma la descripcion de la unidad de negocio de la tabla de idioma;
   SQLExec("SELECT B.DESCR FROM PS_BUS_UNIT_GL_VW A, PS_BUS_UNIT_LANG B WHERE A.BUSINESS_UNIT=B.BUSINESS_UNIT AND B.LANGUAGE_CD='ESP' AND A.BUSINESS_UNIT_AP = :1", &BUSINESS_UNIT, &DESCR_BU);
   REM-->002-FIN;
   &rsheader.GetRow(1).FF_VCHR_DAT_WRK.DESCR.Value = &DESCR_BU;
   /*Consecutivo CDP o CRP*/
   If &str_tipo = "CDP" Then
      &rsheader.GetRow(1).FF_VCHR_DAT_WRK.FF_LAST_NBR_CDP.Value = FF_GL_VCHR_TBL.FF_LAST_NBR_CDP.Value;
   Else
      &rsheader.GetRow(1).FF_VCHR_DAT_WRK.FF_LAST_NBR_CRP.Value = FF_GL_VCHR_TBL.FF_LAST_NBR_CRP.Value;
   End-If;
   /*ID Documento*/
   &ID_DOCUMENTO = VOUCHER.VOUCHER_ID.Value;
   &rsheader.GetRow(1).FF_VCHR_DAT_WRK.VOUCHER_ID.Value = &ID_DOCUMENTO;
   /*Fecha Documento*/
   &rsheader.GetRow(1).FF_VCHR_DAT_WRK.ACCOUNTING_DT.Value = VOUCHER.ACCOUNTING_DT.Value;
   /*Usuario*/
   SQLExec("SELECT OPRID FROM PS_VCHR_HDCRRCT_VW WHERE BUSINESS_UNIT = :1 AND VOUCHER_ID = :2", &BUSINESS_UNIT, &ID_DOCUMENTO, &USUARIO);
   &rsheader.GetRow(1).FF_VCHR_DAT_WRK.OPRID.Value = &USUARIO;
   /*Aprobador*/
   &rsheader.GetRow(1).FF_VCHR_DAT_WRK.OPRID2.Value = FF_GL_VCHR_TBL.OPRID.Value;
   /*Area Solicitante*/
   &SETID = GetSetId(Field.BUSSINES_UNIT, &BUSINESS_UNIT, Record.VOUCHER, "");
   /*ASM - No debe utilizar SETID para obtener el area solicitante*/
   rem ASM SQLExec("SELECT B.DESCR FROM PS_OPR_DEF_TBL_PM A, PS_DEPT_TBL B WHERE A.OPRID = :1 AND B.SETID = :2 AND A.DEPTID = B.DEPTID", &USUARIO, &SETID, &AREA_SOLI);
   SQLExec("SELECT B.DESCR FROM PS_OPR_DEF_TBL_PM A, PS_DEPT_TBL B WHERE A.OPRID = :1 AND A.DEPTID = B.DEPTID", &USUARIO, &AREA_SOLI);
   /*Fin ASM*/
   &rsheader.GetRow(1).FF_VCHR_DAT_WRK.DESCR1.Value = &AREA_SOLI;
   /*Ordenador del Gasto*/
   &rsheader.GetRow(1).FF_VCHR_DAT_WRK.LC_NOMBRE_TERCERO.Value = FF_TERCERO_VW.LC_NOMBRE_TERCERO.Value;
   /*Nombre del Documento*/
   &rsheader.GetRow(1).FF_VCHR_DAT_WRK.INVOICE_ID.Value = VOUCHER.INVOICE_ID.Value;
   /*CDP y ID Proveedor*/
   If &str_tipo = "CRP" Then
      &rsheader.GetRow(1).FF_VCHR_DAT_WRK.FF_LAST_NBR_CDP.Value = FF_GL_VCHR_TBL.FF_LAST_NBR_CDP.Value;
      &VENDOR_ID = VOUCHER.VENDOR_ID.Value;
      &rsheader.GetRow(1).FF_VCHR_DAT_WRK.VENDOR_ID.Value = &VENDOR_ID;

      SQLExec("SELECT LC_TERCERO_ID FROM PS_LC_TERCERO WHERE VENDOR_ID = :1 ", &VENDOR_ID, &LC_TERC_ID);
      SQLExec("SELECT A.LC_NOMBRE_TERCERO FROM PS_LC_TERCERO_EFF A WHERE A.LC_TERCERO_ID = :1 AND %EFFDTCHECK(LC_TERCERO_EFF B, A, %CURRENTDATEIN)", &LC_TERC_ID, &NOMBRE_PROVE);
      &rsheader.GetRow(1).FF_VCHR_DAT_WRK.DESCR100.Value = &NOMBRE_PROVE;
   End-If;
   /*Comentarios*/
   SQLExec("SELECT DESCR254_MIXED FROM PS_VOUCHER WHERE BUSINESS_UNIT = :1 AND VOUCHER_ID = :2", &BUSINESS_UNIT, &ID_DOCUMENTO, &COMENTARIOS);
   &rsheader.GetRow(1).FF_VCHR_DAT_WRK.DESCR254_MIXED.Value = &COMENTARIOS;
   /*Total*/
   /*inicio 004*/

   rem &rsheader.GetRow(1).FF_VCHR_DAT_WRK.GROSS_AMT.Value = VOUCHER.GROSS_AMT.Value;
   rem  &rsheader.GetRow(1).FF_VCHR_DAT_WRK.DESCR254.Value = NroLetra(VOUCHER.GROSS_AMT.Value);
   SQLExec("select ETY_IMPR_CDP_CRP from ps_ETY_BUS_UN_T_AP where BUSINESS_UNIT=:1", VOUCHER.BUSINESS_UNIT.Value, &flagCRPCDP);
   If (&flagCRPCDP = "Y") Then
      SQLExec("select sum(foreign_amount) from ps_KK_ACT_LOG_vw where  BUSINESS_UNIT_APPL=:1 and voucher_id=:2 and KK_SOURCE_TRAN ='AP_VOUCHER'", VOUCHER.BUSINESS_UNIT.Value, VOUCHER.VOUCHER_ID.Value, &totalPptal);
      &rsheader.GetRow(1).FF_VCHR_DAT_WRK.GROSS_AMT.Value = &totalPptal;
      &rsheader.GetRow(1).FF_VCHR_DAT_WRK.DESCR254.Value = NroLetra(&rsheader.GetRow(1).FF_VCHR_DAT_WRK.GROSS_AMT.Value);
   Else
      &rsheader.GetRow(1).FF_VCHR_DAT_WRK.GROSS_AMT.Value = VOUCHER.GROSS_AMT.Value;
      &rsheader.GetRow(1).FF_VCHR_DAT_WRK.DESCR254.Value = NroLetra(VOUCHER.GROSS_AMT.Value);

   End-If;
   /*fin 004*/


   /*CARGO CABECERA*/
   &rs_Comp = GetLevel0();
   /*CARGO NIVEL LINEAS*/
   &rs_Comp_Lin = GetLevel0().GetRow(1).GetRowset(Scroll.VOUCHER_LINE);
   &rsLineas = &rsheader.GetRow(1).GetRowset(Scroll.FF_VCHRLINE_WRK);
   /*Recorrer las lineas del voucher*/
   For &i = 1 To &rs_Comp_Lin.ActiveRowCount;
      &str_Articulo = &rs_Comp_Lin(&i).VOUCHER_LINE.DESCR.Value;

      &rs_Comp_Lin_dist = &rs_Comp_Lin(&i).GetRowset(Scroll.DISTRIB_LINE);
      /*Recorrer las lineas de Distribución*/
      For &j = 1 To &rs_Comp_Lin_dist.ActiveRowCount;


         rem &rs_Comp_Lin_dist.GetRow(&j).GetRecord(Record.DISTRIB_LINE).CopyFieldsTo(&rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_TBL);
         /*Centro de Costo (Deptid + descripcion)*/
         &str_Deptid = &rs_Comp_Lin_dist(&j).DISTRIB_LINE.DEPTID.Value;
         SQLExec("SELECT B.DESCR FROM PS_DEPT_TBL B WHERE B.SETID = :1 AND B.DEPTID = :2 AND %EFFDTCHECK(DEPT_TBL A, B, %CURRENTDATEIN) AND B.EFF_STATUS = 'A'", &SETID, &str_Deptid, &str_Descr);
         &str_bu_gl = &rs_Comp_Lin_dist(&j).DISTRIB_LINE.BUSINESS_UNIT_GL.Value;
         &SETID_GL = GetSetId(Field.BUSSINES_UNIT, &str_bu_gl, Record.LED_GRP_TBL, "");

         /* Grupo Contable */
         &strGrupoContable = getGrupoContable(&SETID_GL, &str_bu_gl);
         rem MessageBox(0, "", 0, 0, "ACA " | &strGrupoContable);
         /*Cuenta Ppto*/
         &strCuentaContable = &rs_Comp_Lin_dist(&j).DISTRIB_LINE.ACCOUNT.Value;
         /*INICIO CHGA 003*/
         &strCtaPres = " ";
         /*FIN CHGA 003*/

         &strCtaPres = getCuentaPresupuesto(&SETID_GL, &strCuentaContable, &strGrupoContable);
         /*INICIO CHGA 003*/
         If &strCtaPres <> "" Then
            /*FIN CHGA 003*/

            &rsLineas.InsertRow(&rsLineas.ActiveRowCount);
            &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.DEPTID.Value = &str_Deptid;
            &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.DESCR.Value = &str_Descr;
            &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.ACCOUNT.Value = &strCtaPres;
            /* Descripcion de Cuenta Presupuestaria */
            &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.DESCR100.Value = getCuentaPresupDescr(&SETID_GL, &strCtaPres);

            /*Articulo*/
            &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.DESCR1.Value = &str_Articulo;
            /*Vigencia*/
            &fecha_presu = &rs_Comp_Lin_dist(&j).DISTRIB_LINE.BUDGET_DT.Value;
            /* Ledger Ppto */
            &strLedger = getLedger(&SETID_GL, &strGrupoContable);
            rem MessageBox(0, "", 0, 0, "ACA 1 " | &strLedger);
            /* Periodo */
            &strPeriodo = getPeriodo(&SETID_GL, &strGrupoContable, &fecha_presu);
            &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.BUDGET_PERIOD.Value = &strPeriodo;

            /* Saldo al Inicio del Periodo */
            /*ASM - En el record que paso como parametro le seteo el campo ACCOUNT para que tenga el valor de la cuenta de presupuesto y no la contable ya que es la cuenta de presupuesto la que se utiliza para obtener los saldos*/
            &recinfo = CreateRecord(Record.DISTRIB_LINE);
            &rs_Comp_Lin_dist.GetRow(&j).GetRecord(Record.DISTRIB_LINE).CopyFieldsTo(&recinfo);
            &recinfo.ACCOUNT.Value = &strCtaPres;
            &nbrSaldoInicioPeriodo = getSaldoInicioPeriodo(&recinfo, &SETID_GL, &strLedger, &strGrupoContable, &strPeriodo);

            /* Gastos en Periodo hasta la fecha de la solicitud inclusive, esto incluye tambien a la solicitud misma */
            rem &nbrGastosEnPeriodo = getGastosEnPeriodo(&strGrupoContable, &strCtaPres, &strDeptId, &strPeriodo, &strLedger, &dt_BudgetDT);

            rem-->002 se comenta el metodo GetGAstosEnPeriodo, se cambia por el metodo getTransaccionEnPeriodoHastaID;
            SQLExec("SELECT A.KK_TRAN_ID FROM PS_KK_SOURCE_HDR A WHERE A.BUSINESS_UNIT=:1 AND A.VOUCHER_ID=:2", VOUCHER.BUSINESS_UNIT.Value, VOUCHER.VOUCHER_ID.Value, &idTransac);
            &nbrGastosEnPeriodo = getTransaccionEnPeriodoHastaID(&recinfo, &SETID_GL, &strGrupoContable, &strPeriodo, &idTransac);
            REM   &nbrGastosEnPeriodo = getGastosEnPeriodo(&recinfo, &SETID_GL, &strGrupoContable, &strPeriodo, &strLedger, &fecha_presu);
            REM-->002-FIN;
            /* Saldo Actual = (Saldo al Inicio del Periodo)  - (Gastos en Periodo hasta la fecha de la solicitud inclusive) */
            rem-->002 Las transaciones hasta el id de transaccion del voucher representan la transaccion de Ingrego menos las transaccion de gravamen, pregravamen y gastos;
            rem &nbrSaldoActual = &nbrSaldoInicioPeriodo - &nbrGastosEnPeriodo;
            &nbrSaldoActual = &nbrGastosEnPeriodo;
            &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.AMT3.Value = &nbrSaldoActual * - 1;
            rem-->002-fin;
            /*Importe*/
            &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.MERCHANDISE_AMT.Value = &rs_Comp_Lin_dist(&j).DISTRIB_LINE.MERCHANDISE_AMT.Value;
            &nbr_lineas_act = &rsLineas.ActiveRowCount;

            /*Si el iva es PRORRATEAD y NODESC entonces se le agrega al valor el valor del iva.*/
            If &rs_Comp_Lin(&i).VOUCHER_LINE.VAT_USE_ID.Value = "NODESC" Then
               If &rs_Comp.GetRow(1).GetRecord(Record.VOUCHER).GetField(Field.VAT_NRCVR_CHRG_CD).Value = "PRORRATEAD" Then
                  &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.MERCHANDISE_AMT.Value = &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.MERCHANDISE_AMT.Value + &rs_Comp_Lin_dist(&j).DISTRIB_LINE.VAT_CALC_AMT.Value;
               Else
                  /*Busca la cuenta del iva*/
                  &str_setid = GetSetId(Field.BUSINESS_UNIT, VOUCHER.BUSINESS_UNIT.Value, Record.VAT_DST_TBL, "");
                  SQLExec(SQL.FF_CUENTA_IVA, &str_setid, &rs_Comp_Lin(&i).VOUCHER_LINE.TAX_CD_VAT.Value, &str_account);

                  &str_account = getCuentaPresupuesto(&SETID_GL, &str_account, &strGrupoContable);
                  &str_descr_account = getCuentaPresupDescr(&SETID_GL, &str_account);
                  rem                &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.ACCOUNT.Value = &strCtaPres;

                  &bol_cuenta = False;
                  &nbr_lineas = 2;
                  While &nbr_lineas <= &rsLineas.ActiveRowCount And
                        &bol_cuenta = False

                     If &rsLineas.GetRow(&nbr_lineas).FF_VCHRLINE_WRK.ACCOUNT.Value = &str_account Then
                        &rsLineas.GetRow(&nbr_lineas).FF_VCHRLINE_WRK.MERCHANDISE_AMT.Value = &rsLineas.GetRow(&nbr_lineas).FF_VCHRLINE_WRK.MERCHANDISE_AMT.Value + &rs_Comp_Lin_dist(&j).DISTRIB_LINE.VAT_CALC_AMT.Value;
                        &rsLineas.GetRow(&nbr_lineas_act).FF_VCHRLINE_WRK.AMT1.Value = &rsLineas.GetRow(&nbr_lineas_act).FF_VCHRLINE_WRK.AMT1.Value + &rs_Comp_Lin_dist(&j).DISTRIB_LINE.VAT_CALC_AMT.Value;
                        &bol_cuenta = True;

                     End-If;
                     &nbr_lineas = &nbr_lineas + 1;
                  End-While;

                  /*Inserta la nueva línea del iva*/
                  REM-->002 Solo se imprime la linea de iva, si este tiene un valor;
                  If Not &bol_cuenta And
                        All(&rs_Comp_Lin_dist(&j).DISTRIB_LINE.VAT_CALC_AMT.Value) Then
                     REM-->002-fin;
                     &rsLineas.InsertRow(&rsLineas.ActiveRowCount);
                     &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.DEPTID.Value = &str_Deptid;
                     &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.DESCR.Value = &str_Descr;
                     &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.ACCOUNT.Value = &str_account;
                     &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.DESCR1.Value = &str_Articulo;
                     &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.BUDGET_PERIOD.Value = &strPeriodo;
                     &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.DESCR100.Value = &str_descr_account;

                     &recinfo = CreateRecord(Record.DISTRIB_LINE);
                     &rs_Comp_Lin_dist.GetRow(&j).GetRecord(Record.DISTRIB_LINE).CopyFieldsTo(&recinfo);
                     &recinfo.ACCOUNT.Value = &str_account;
                     &nbrSaldoInicioPeriodo = getSaldoInicioPeriodo(&recinfo, &SETID_GL, &strLedger, &strGrupoContable, &strPeriodo);




                     /* Gastos en Periodo hasta la fecha de la solicitud inclusive, esto incluye tambien a la solicitud misma */
                     rem &nbrGastosEnPeriodo = getGastosEnPeriodo(&strGrupoContable, &strCtaPres, &strDeptId, &strPeriodo, &strLedger, &dt_BudgetDT);
                     &nbrGastosEnPeriodo = getGastosEnPeriodo(&recinfo, &SETID_GL, &strGrupoContable, &strPeriodo, &strLedger, &fecha_presu);

                     /* Saldo Actual = (Saldo al Inicio del Periodo)  - (Gastos en Periodo hasta la fecha de la solicitud inclusive) */
                     &nbrSaldoActual = &nbrSaldoInicioPeriodo - &nbrGastosEnPeriodo;
                     &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.AMT3.Value = &nbrSaldoActual;

                     /*Importe*/
                     &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.MERCHANDISE_AMT.Value = &rs_Comp_Lin_dist(&j).DISTRIB_LINE.VAT_CALC_AMT.Value;
                     If &str_account = "" Then
                        &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.AMT1.Value = 0;
                     Else
                        &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.AMT1.Value = &nbrSaldoActual + &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.MERCHANDISE_AMT.Value;
                     End-If;


                  End-If;

               End-If;
            End-If;

            /*Si el iva es no descontable se resta del valor total del cdp o crp*/
            If &rs_Comp_Lin(&i).VOUCHER_LINE.VAT_USE_ID.Value <> "NODESC" Then
               &rsheader.GetRow(1).FF_VCHR_DAT_WRK.GROSS_AMT.Value = &rsheader.GetRow(1).FF_VCHR_DAT_WRK.GROSS_AMT.Value - &rs_Comp_Lin_dist(&j).DISTRIB_LINE.VAT_CALC_AMT.Value;
            End-If;

            /*Saldo Disponible*/
            If &strCtaPres = "" Then
               REM BY CHGA          &rsLineas.GetRow(&rsLineas.ActiveRowCount).FF_VCHRLINE_WRK.AMT1.Value = &nbrSaldoActual + &rs_Comp_Lin_dist(&j).DISTRIB_LINE.MERCHANDISE_AMT.Value;
               &rsLineas.GetRow(&nbr_lineas_act).FF_VCHRLINE_WRK.AMT1.Value = 0;
            Else
               &rsLineas.GetRow(&nbr_lineas_act).FF_VCHRLINE_WRK.AMT1.Value = &rsLineas.GetRow(&nbr_lineas_act).FF_VCHRLINE_WRK.AMT3.Value + &rsLineas.GetRow(&nbr_lineas_act).FF_VCHRLINE_WRK.MERCHANDISE_AMT.Value;
            End-If;
            REM-->002 Segun solicitud del usuario Yolanda Novoa para los CRP el saldo disponible debe ser igual al valor del importe para un toatl de cero en el saldo actual;
            If &str_tipo = "CRP" Then
               &rsLineas.GetRow(&nbr_lineas_act).FF_VCHRLINE_WRK.AMT1.Value = &rsLineas.GetRow(&nbr_lineas_act).FF_VCHRLINE_WRK.MERCHANDISE_AMT.Value;
               &rsLineas.GetRow(&nbr_lineas_act).FF_VCHRLINE_WRK.AMT3.Value = 0;
            End-If;
            REM-->002-fin;
            /*INICIO CHGA 003*/
         End-If;
         /*FIN CHGA 003*/

      End-For;
   End-For;
   /*Borro la línea 1 que esta vacía */
   &rsheader.GetRow(1).GetRowset(Scroll.FF_VCHRLINE_WRK).DeleteRow(1);

   <*   
/*Create XSD Se ejecuta una sola vez */
   &rds = create psxp_xmlgen:RowSetDS();
   &myschema = &rds.getXSDSchema(&rsheader);
   &myschema = Replace(&myschema, 20, 3, " encoding = 'utf-8'?>");
   &fl = GetFile("C:\FF_GL_VCHR_REPORT.xsd", "W", "UTF-8", %FilePath_Absolute);
   &fl.WriteLine(&myschema);
   &fl.Close();
  *>

   /* Setup Report */
   &sLanguageCD = %Language_User;
   &dAsOfDate = %Date;
   &sOutFormat = "PDF";
   /*Nombre del archivo XML*/
   &FileXMLGen = "FF_GL_VCHR_REPORT.XML";


   /*Create XML File */
   Local string &str_filename;
   &flFileTmp = GetFile(&FileXMLGen, "W", "UTF-8", %FilePath_Relative);
   If &flFileTmp.IsOpen Then
      &rds = create psxp_xmlgen:RowSetDS();
      /*obtengo el XML del Rowset con la información &RS1 */
      &myXMLFile = &rds.getXMLData(&rsheader, "");
      &myXMLFile = Replace(&myXMLFile, 20, 3, " encoding = 'utf-8'?>");
      &flFileTmp.WriteLine(&myXMLFile);
      &str_filename = &flFileTmp.name;
      &flFileTmp.Close();
   End-If;

   If &str_tipo = "CDP" Then
      /* Setup Defn XML */
      &strReportName = "FF_VCHR_CDP";
      &strTemplateName = "FF_VCHR_CDP_1";
      &FileXMLPath = %FilePath_Relative;
      &OutputPDFFilename = "ImpresoCDP";
   End-If;

   If &str_tipo = "CRP" Then
      /* Setup Defn XML */
      &strReportName = "FF_VCHR_CRP";
      &strTemplateName = "FF_VCHR_CRP_1";
      &FileXMLPath = %FilePath_Relative;
      &OutputPDFFilename = "ImpresoCRP";
   End-If;

   /* Creo Reporte en funciòn del reporte*/
   &ReportImprimir = create PSXP_RPTDEFNMANAGER:ReportDefn(&strReportName);
   &ReportImprimir.Get();

   /*Obtengo el origen de los datos del reporte, en este caso el archivo XML*/
   &ReportImprimir.SetRuntimeDataXMLFile(&str_filename);
   /*Genero el reporte*/
   &ReportImprimir.ProcessReport(&strTemplateName, &sLanguageCD, &dAsOfDate, &sOutFormat);
   CommitWork();

   &ReportImprimir.DisplayOutput();

   /* Borrado del archivo Xml Generado */
   &File = GetFile(&FileXMLGen, "W", "UTF-8", %FilePath_Relative);
   &File.Delete();
   &File.Close();

End-Function;

